import React from 'react';
import './styles.css'

const Cats = () => {
  return (
    <div className="cats-wrapper">
      <ul>
        {catsList.map((cat)=>{
          return (
            <li key={cat.id}>
              <img src={cat.url} alt="" />
            </li>
          )
        })}
        <li></li>
      </ul>
    </div>
  )
}

export default Cats;
